import "./footer.scss";

function Footer() {
  return (
    <div>
      <div>
        <div>
          <img src="" />
        </div>
        <div>
          <p>Akun Media Sosial</p>
        </div>
      </div>
      <div>
        <p>Copyright</p>
      </div>
    </div>
  );
}

export default Footer;
